Most data interfaces will have three implementations: (1) the entity class for the application core, (2) the data access object for the persistence layer, and (3) the data transfer object for the web layer. This approach provides a clear separation of concerns where each class has a distinct, single responsibility. However, it comes at the cost of requiring mapping code at the layer boundaries. The preferred way to implement this is without any third-party packages but with simple static factory methods. @Getter
@Builder
// ...
public class PatientEntity implements Patient { private final UUID id; private final String name; // ... public static PatientEntity from(Patient patient) { return PatientEntity.builder() .id(patient.getId()) .name(patient.getName()) .age(patient.getAge()) .gender(patient.getGender()) .phoneNumber(patient.getPhoneNumber()) .residentialAddress(patient.getResidentialAddress()) .patientCategory(patient.getPatientCategory()) .build(); }
}
